Audio: MP3, WAV, M4A, AAC, CAF 
Document: ODS, PDF, RTF / RTFD, DOC / DOCX, XLS / XLSX, PPT / PPTX, CSV, CHM 
Text: HTM / HTML, TXT ... 
Picture: JPG / JPEG, GIF, PNG, TIFF, BMP, TGA ...



